import styled from "styled-components";
import Post from "./Post";

const TemplateBlock = styled.div`
  padding-top: 1.11rem;
  box-sizing: border-box;
  background: #222222;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-flow: row wrap;
`;

const PostTemplate = () => {
  return (
    <TemplateBlock>
      <Post />
      <Post />
    </TemplateBlock>
  );
};

export default PostTemplate;
